import React from "react";
import { Row, Card, Col, Button, Nav } from "react-bootstrap";
import { Link, useHistory } from "react-router-dom";
export default function Categories({ category }) {
  const navigate = useHistory();
  const updateCategory = () => {
    let path = `/CreateCategory/${category._id}`;

    navigate.push(path);
  };
  return (
    <>
      <Col xl="6">
        <Card>
          <Row>
            <Col md="5" xl="3">
              <div class="new-arrival-product mb-xxl-4 mb-md-0 mb-4">
                <div class="new-arrivals-img-contnent">
                  <Image cloudName="djpdvrlkk" publicId={category.image} />
                </div>
              </div>
            </Col>
            <Col md="7" xl="12">
              <Card.Header>
                <Card.Title>
                  {category.name}
                  <Button className="me-2" variant="danger btn-rounded">
                    Remove
                  </Button>
                  <Button
                    className="me-2"
                    variant="success"
                    onClick={updateCategory}
                  >
                    Update
                  </Button>
                </Card.Title>
              </Card.Header>

              <Card.Body>
                <Card.Text>{category.description}</Card.Text>
              </Card.Body>
              <Card.Footer className=" d-sm-flex justify-content-between align-items-center">
                <Card.Text className=" text-dark d-inline">
                  Last updated 3 mins ago
                </Card.Text>

                <Link to={"#"} className="btn btn-primary">
                  Go somewhere
                </Link>
              </Card.Footer>
            </Col>
          </Row>
      </Card>
      </Col>{" "}
    </>
  );
}
